/span></div><div class="t m0 x2 h4 ye ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Interfere with the www.talegaon.co.in site. <span class="ff4"> </span></span></span></div><div class="t m0 x2 h4 yf ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Use profanity on the site. </span></span></div><div class="t m0 x2 h4 y10 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Infringe on www.talegaon.co.ins intellectual property. <span class="ff4"> </span></span></span></div><div class="t m0 x2 h4 y11 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Create a new account or buy a<span class="_ _0"></span>nd sell on other existing accounts to avoid restrictions or<span class="_ _1"></span> </span></span></div><div class="t m0 x3 h4 y12 ff4 fs2 fc0 sc0 ls0 ws0">limits. </div><div class="t m0 x2 h4 y13 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Make offers to buy or sell outside of www.talegaon.co.in.<span class="ff4"> </span></span></span></div><div class="t m0 x1 h3 y14 ff3 fs2 fc0 sc0 ls0 ws0">In addition to rules that apply to all www.talegaon.co.in member<span class="_ _0"></span>s, www.talegaon.co.in also </div><div class="t m0 x1 h4 y15 ff4 fs2 fc0 sc0 ls0 ws0">has rules specifically about Feedback, buying and selling. </div><div class="t m0 x1 h5 y16 ff2 fs3 fc0 sc0 ls0 ws0">Rules about id<span class="_ _0"></span>entity<span class="fs2">:-<span class="ff4"> </span></span></div><div class="t m0 x1 h4 y17 ff4 fs2 fc0 sc0 ls0 ws0">Member ide<span class="ff3">ntity is a building block of the www.talegaon.c<span class="_ _0"></span>o.in Communit<span class="_ _1"></span>y. </span></div><div class="t m0 x1 h3 y18 ff3 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in treats member identity with great respec<span class="_ _0"></span>t. www.talegaon.co.in expects </div><div class="t m0 x1 h4 y19 ff4 fs2 fc0 sc0 ls0 ws0">Community members to treat member<span class="_ _0"></span> identit<span class="_ _1"></span>y with the same level of respect. </div><div class="t m0 x1 h4 y1a ff3 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in me<span class="ff4">mbers:  </span></div><div class="t m0 x2 h4 y1b ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Must be at least 18 years old.  </span></span></div><div class="t m0 x2 h4 y1c ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Cannot misrepresent their identities.  </span></span></div><div class="t m0 x2 h4 y1d ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Must always provide valid and complete contact information and must alway<span class="_ _0"></span>s have a </span></span></div><div class="t m0 x3 h4 y1e ff4 fs2 fc0 sc0 ls0 ws0">valid email address.  </div><div class="t m0 x2 h4 y1f ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Cannot publish the contact information of other members in an online public area.  </span></span></div><div class="t m0 x2 h4 y20 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Must follow the rules of www.talegaon.co.in <span class="ff4"> </span></span></span></div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x3 h4 y21 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h5 y22 ff2 fs3 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h6 y23 ff7 fs0 fc0 sc0 ls0 ws0">Rules about co<span class="_ _0"></span>mmunicating with o<span class="_ _0"></span>ther </div><div class="t m0 x1 h6 y24 ff8 fs0 fc0 sc0 ls0 ws0">www.talegao<span class="_ _0"></span>n.co.in memb<span class="_ _0"></span>ers:<span class="ff7">- </span></div><div class="t m0 x1 h2 y25 ff2 fs1 fc0 sc0 ls0 ws0">Overview<span class="ff7 fs0"> </span></div><div class="t m0 x1 h6 y26 ff3 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in members:<span class="ff7 fs0"> </span></div><div class="t m0 x2 h4 y27 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Cannot misuse the <span class="ff3">www.talegaon.co.in email forwarding system, send unsolicited </span></span></span></div><div class="t m0 x3 h4 y28 ff4 fs2 fc0 sc0 ls0 ws0">email (spam) or email threats to other members. </div><div class="t m0 x2 h7 y29 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Must follow www.talegaon.co.ins rules for www.talegaon.c<span class="_ _0"></span>o.in Discussion Boards </span></span></div><div class="t m0 x3 h4 y2a ff4 fs2 fc0 sc0 ls0 ws0">and Community Content (includes blog entries). </div><div class="t m0 x1 h5 y2b ff2 fs3 fc0 sc0 ls0 ws0">Rules about <span class="_ _0"></span>www<span class="ff9">.talegaon.co.ins re<span class="_ _0"></span>sponsibilities:<span class="ff2">-<span class="ff4"> </span></span></span></div><div class="t m0 x2 h4 y2c ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">www.talegaon.co.ins Privacy Policy specifies how y<span class="_ _0"></span>our personal information is used.<span class="_ _1"></span><span class="ff4"> </span></span></span></div><div class="t m0 x