0 ws0"> </div><div class="t m0 x1 h8 y67 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y68 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y69 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y6a ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y6b ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y6c ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y6d ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y6e ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y6f ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y70 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y71 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y72 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y73 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y74 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y75 ffa fs5 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf5" class="pf w0 h0" data-page-no="5"><div class="pc pc5 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h8 y3d ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y3e ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y3f ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h8 y40 ffa fs5 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h6 y41 ff7 fs0 fc0 sc0 ls0 ws0">Rules for Buye<span class="_ _0"></span>rs <span class="ff8"></span> Overview </div><div class="t m0 x1 h4 y76 ff4 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in&apos;s policies are<span class="_ _0"></span> rules and guidelines that help<span class="_ _1"></span> to create a safe, fair and </div><div class="t m0 x1 h3 y77 ff3 fs2 fc0 sc0 ls0 ws0">enjoyable trading environment for all www.talegaon.co.in members. As a buyer, you are </div><div class="t m0 x1 h3 y78 ff3 fs2 fc0 sc0 ls0 ws0">responsible for reviewing and understanding www.talegaon.co.ins policies, as well as all </div><div class="t m0 x1 h4 y79 ff4 fs2 fc0 sc0 ls0 ws0">applicable laws and regulations as outlined in the User Agreement. </div><div class="t m0 x1 h4 y7a ff3 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.ins policies are intended to:<span class="ff4"> </span></div><div class="t m0 x2 h4 y7b ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Support government laws and regulations  </span></span></div><div class="t m0 x2 h4 y7c ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Minimize risks to buyers and sellers </span></span></div><div class="t m0 x2 h4 y7d ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Provide equal opportunity<span class="_ _0"></span> to all bu<span class="_ _1"></span>yers  </span></span></div><div class="t m0 x2 h4 y2c ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Provide an enjoyable buying experience  </span></span></div><div class="t m0 x2 h4 y7e ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Support the values of the www.talegaon.co.in Community<span class="ff4"> </span></span></span></div><div class="t m0 x1 ha y7f ff2 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 ha y80 ff2 fs2 fc0 sc0 ls0 ws0">Buyers cannot:<span class="ff4"> </span></div><div class="t m0 x2 h4 y81 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Commit to purchasing an item (either by winning the item or buy<span class="_ _0"></span>ing an item in a Bu<span class="_ _1"></span>y I<span class="_ _0"></span>t </span></span></div><div class="t m0 x3 h4 y82 ff4 fs2 fc0 sc0 ls0 ws0">Now listing) without paying. To understand the penalties. purchase with no serious </div><div class="t m0 x3 h4 y83 ff3 fs2 fc0 sc0 ls0 ws0">intention of buying. Most of the items on www.talega<span class="_ _0"></span>on.co.in are au<span class="ff4">ction<span class="_ _1"></span>-like listings </span></div><div class="t m0 x3 h4 y84 ff4 fs2 fc0 sc0 ls0 ws0">and each purchase <span class="ff3">is a binding contract. Certain www.talegaon.co.in online auctions </span></div><div class="t m0 x3 h4 y85 ff4 fs2 fc0 sc0 ls0 ws0">involve non-binding purchases (for example, some real estate auctions). However, these </div><div class="t m0 x3 h4 y86 ff4 fs2 fc0 sc0 ls0 ws0">non-binding purchase<span class="ff3">s represent a buyers serious expression of interest in buy<span class="_ _0"></span>ing the </span></div><div class="t m0 x3 h4 y87 ff3 fs2 fc0 sc0 ls0 ws0">sellers item, and insincere <span class="ff4">purchase is not permitted.  </span></div><div class="t m0 x2 h4 y88 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Misuse the purchase retraction option to manipulate the purchase process. </span></span></div><div class="t m0 x2 h4 y89 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Purchase or buy <span class="ff3">an item when they do not meet the seller<span class="_ _0"></span>s terms as outlined in the item </span></span></span></div><div class="t m0 x3 h4 y8a ff4 fs2 fc0 sc0 ls0 ws0">listing, or purchase or buy with the intention of disrupting a listing. This is known as </div><div class="t m0 x3 h4 y8b ff4 fs2 fc0 sc0 ls0 ws0">unwelcome and malicious buying. </div><div class="t m0 x1 h4 y8c ff4 fs2 fc0 sc0 ls0 ws0">Both buyers and sellers cannot interfe<span class="_ _0"></span>re with a transaction o<span class="_ _1"></span>r offer to buy or sell listed items </div><div class="t m0 x1 h4 y8d ff3 fs2 fc0 sc0 ls0 ws0">outside of the www.talegaon.co.in site (see Rules for Everyone<span class="_ _0"></span> <span class="ff4"> Ov<span class="_ _1"></span>erview). </span></div><div class="t m0 x1 h4 y8e ff3 fs2 fc0 sc0 ls0 ws0">To know about www.talegaon.co.ins rules that apply to selling, see Rules for Sellers <span class="ff4"> </span></div><div class="t m0 x1 h4 y8f ff4 fs2 fc0 sc0 ls0 ws0">Overview. </div><div class="t m0 x1 h4 y90 ff4 fs2 fc0 sc0 ls0 ws0"> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf6" class="pf w0 h0" data-page-no="6"><div class="pc pc6 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x1 h4 y21 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h4 y91 ff4 fs2 fc0 sc0 ls0 ws0">Violations of these policies may<span class="_ _0"></span> result in a r<span class="_ _1"></span>ange of actions, including: </div><div class="t m0 x2 h4 y92 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Listing cancellation </span></span></div><div class="t m0 x2 h4 y93 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Limits on account privilege<span class="_ _0"></span>s<span class="_ _1"></span> </span></span></div><div class="t m0 x2 h4 y94 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Account suspension  </span></span></div><div class="t m0 x2 h4 y95 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Forfeit of www.talegaon.co.in fees on ca<span class="_ _0"></span>ncelled listings <span class="_ _1"></span><span class="ff4"> </span></span></span></div><div class="t m0 x2 h4 y96 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Loss of Power-Seller status  </span></span></div><div class="t m0 x1 ha y97 ff2 fs2 fc0 sc0 ls0 ws0">To report a policy violation:<span class="ff4"> </span></div><div class="t m0 x2 h4 y98 ff4 fs2 fc0 sc0 ls0 ws0">1.<span class="ff6"> <span class="_ _3"> </span><span class="ff3">Click the Contact Us link on the </span></span>Website. </div><div class="t m0 x2 h4 y99 ff4 fs2 fc0 sc0 ls0 ws0">2.<span class="ff6"> <span class="_ _3"> </span></span>Enter the data you wish to report. </div><div class="t m0 x1 ha y9a ff2 fs2 fc0 sc0 ls0 ws0">Note: <span class="ff4">Only report a case once. Multiple emails about the same case slow an investigation. </span></div><div class="t m0 x1 h4 y9b ff4 fs2 fc0 sc0 ls0 ws0">After your report is received: </div><div class="t m0 x2 h7 y9c ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">www.talegaon.co.in will consider the circ<span class="_ _0"></span>umstances of an alleged offense and the </span></span></div><div class="t m0 x3 h4 y9d ff3 fs2 fc0 sc0 ls0 ws0">members<span class="ff4"> trading record before taking action. </span></div><div class="t m0 x2 h4 y9e ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">If a complaint can&apos;t be proven with certa<span class="_ _0"></span>int<span class="_ _1"></span>y, www.talegaon.c<span class="_ _0"></span>o.in ma<span class="_ _1"></span>y take no ac<span class="_ _0"></span>tion.<span class="_ _1"></span><span class="ff4"> </span></span></span></div><div class="t m0 x2 h7 y9f ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Due to privacy issues, it is not possible for www.talegaon.co.in to discuss the results of </span></span></div><div class="t m0 x3 h4 ya0 ff4 fs2 fc0 sc0 ls0 ws0">an investigation. </div><div class="t m0 x1 hb ya1 ff2 fs0 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h4 ya2 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h4 ya3 ff4 fs2 fc0 sc0 ls0 ws0"> </div><div class="t m0 x1 h6 ya4 ff7 fs0 fc0 sc0 ls0 ws0">Rules for Seller<span class="ls1">s <span class="_ _0"></span><span class="ff8 ls0"><span class="ff7"> Overview:- </span></span></span></div><div class="t m0 x1 h4 ya5 ff4 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in&apos;s policies are<span class="_ _0"></span> rules and guidelines that help to create a safe, fair and </div><div class="t m0 x1 h3 ya6 ff3 fs2 fc0 sc0 ls0 ws0">enjoyable trading environment for all www.talegaon.co.in members. As a seller, you are </div><div class="t m0 x1 h3 ya7 ff3 fs2 fc0 sc0 ls0 ws0">responsible for reviewing and understanding www.talegaon.co.ins selling policies, as well as </div><div class="t m0 x1 h4 ya8 ff4 fs2 fc0 sc0 ls0 ws0">all applicable laws and regulations as outlined/mentioned  in the User Ag<span class="_ _0"></span>reement.<span class="_ _1"></span> </div><div class="t m0 x1 ha ya9 ff4 fs2 fc0 sc0 ls0 ws0">Learning about www.talegaon.co.in&apos;s selling<span class="_ _0"></span> policies <span class="_ _1"></span><span class="ff2">before</span> you list an item will help you to </div><div class="t m0 x1 h3 yaa ff3 fs2 fc0 sc0 ls0 ws0">avoid unintentionally breaking rules. www.talegaon.co.ins selling<span class="_ _0"></span> policies are updated to </div><div class="t m0 x1 h4 yab ff4 fs2 fc0 sc0 ls0 ws0">respond to marketplace, Community a<span class="_ _0"></span>nd securit<span class="_ _1"></span>y issues, so it is important to chec<span class="_ _0"></span>k them </div><div class="t m0 x1 h4 yac ff4 fs2 fc0 sc0 ls0 ws0">regularly for changes. </div><div class="t m0 x1 h4 yad ff4 fs2 fc0 sc0 ls0 ws0">Violations of these policies may<span class="_ _0"></span> result in a range of actions, including:<span class="_ _1"></span> </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf7" class="pf w0 h0" data-page-no="7"><div class="pc pc7 w0 h0"><div class="c x0 y0 w1 h0"><div class="t m0 x2 h4 y21 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Listing cancellation  </span></span></div><div class="t m0 x2 h4 yae ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Limits on account privilege<span class="_ _0"></span>s <span class="_ _1"></span> </span></span></div><div class="t m0 x2 h4 yaf ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Account suspension  </span></span></div><div class="t m0 x2 h4 yb0 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">Forfeit of www.talegaon.co.in fees on ca<span class="_ _0"></span>ncelled listings <span class="_ _1"></span><span class="ff4"> </span></span></span></div><div class="t m0 x2 h4 yb1 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Loss of Power-Seller status  </span></span></div><div class="t m0 x1 h4 yb2 ff4 fs2 fc0 sc0 ls0 ws0">Every seller must know and follow: </div><div class="t m0 x2 h4 yb3 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">What items can and cannot be listed  </span></span></div><div class="t m0 x2 h4 yb4 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Rules about Intellectual Property <span class="ff3"></span> Items and listings that have the potential of violating </span></span></div><div class="t m0 x3 h4 yb5 ff4 fs2 fc0 sc0 ls0 ws0">certain copyrights, trademarks, or other rig<span class="_ _0"></span>hts. Intellectual property owners can report </div><div class="t m0 x3 h4 yb6 ff4 fs2 fc0 sc0 ls0 ws0">listings as part of www.talegaon.co.in. </div><div class="t m0 x2 h4 yb7 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Actions that are not allowed in listings  </span></span></div><div class="t m0 x2 h4 yb8 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Payment methods according to nee<span class="_ _0"></span>d of seller/bu<span class="_ _1"></span>yer. </span></span></div><div class="t m0 x1 h4 yb9 ff4 fs2 fc0 sc0 ls0 ws0">In addition to the above rules, here are some<span class="_ _0"></span> additional policy violations not permitted on </div><div class="t m0 x1 h4 yba ff3 fs2 fc0 sc0 ls0 ws0">www.talegaon.co.in:<span class="ff4"> </span></div><div class="t m0 x2 h4 ybb ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Seller Non-performance <span class="ff3"></span> Sellers cannot fail to deliver an item for whic<span class="_ _0"></span>h payment was </span></span></div><div class="t m0 x3 h4 ybc ff4 fs2 fc0 sc0 ls0 ws0">accepted, significantly misrepre<span class="_ _0"></span>sent an item b<span class="_ _1"></span>y not meeting the terms and item </div><div class="t m0 x3 h4 ybd ff4 fs2 fc0 sc0 ls0 ws0">description outlined in the listing, or refuse to accept pay<span class="_ _0"></span>ment for an item at the end of a </div><div class="t m0 x3 h4 ybe ff4 fs2 fc0 sc0 ls0 ws0">successful sale.  </div><div class="t m0 x2 h4 ybf ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Unpaid Item/Final Value Fee Credit Abuse <span class="ff3"></span> Sellers may not file for a Final Value Fee<span class="_ _0"></span> </span></span></div><div class="t m0 x3 h4 yc0 ff4 fs2 fc0 sc0 ls0 ws0">credit on a transaction where the buyer paid for the item.  </div><div class="t m0 x2 h4 yc1 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Tax Policy <span class="ff3"></span> Sellers must pay relevant fees and taxes.  </span></span></div><div class="t m0 x1 h4 yc2 ff4 fs2 fc0 sc0 ls0 ws0">Both buyers and sellers cannot interfe<span class="_ _0"></span>re with a transaction or offer to bu<span class="_ _1"></span>y or sell listed items </div><div class="t m0 x1 h4 yc3 ff3 fs2 fc0 sc0 ls0 ws0">outside of the www.talegaon.co.in site (see Rules for Everyone<span class="_ _0"></span> <span class="ff4"> Ov<span class="_ _1"></span>erview). </span></div><div class="t m0 x1 ha yc4 ff2 fs2 fc0 sc0 ls0 ws0">To report a policy violation:<span class="ff4"> </span></div><div class="t m0 x2 h4 yc5 ff4 fs2 fc0 sc0 ls0 ws0">1.<span class="ff6"> <span class="_ _3"> </span></span>Locate and review the policy page that dea<span class="_ _0"></span>ls with the violation.<span class="_ _1"></span> </div><div class="t m0 x2 h4 yc6 ff4 fs2 fc0 sc0 ls0 ws0">2.<span class="ff6"> <span class="_ _3"> </span></span>See the Excessive Shipping and Handling policy. </div><div class="t m0 x2 h4 yc7 ff4 fs2 fc0 sc0 ls0 ws0">3.<span class="ff6"> <span class="_ _3"> </span></span>Enter the item number(s) of the listing that you want to report. </div><div class="t m0 x2 h4 yc8 ff4 fs2 fc0 sc0 ls0 ws0">4.<span class="ff6"> <span class="_ _3"> </span><span class="ff3">Send your message to www.talegaon.co.in Customer Support.</span></span> </div><div class="t m0 x3 ha yc9 ff4 fs2 fc0 sc0 ls0 ws0">You can also report a violation by clicking the <span class="ff2">Contact Us</span> link. </div><div class="t m0 x1 ha yca ff2 fs2 fc0 sc0 ls0 ws0">After your report is received:<span class="ff4"> </span></div><div class="t m0 x2 h7 ycb ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">www.talegaon.co.in will consider the circ<span class="_ _0"></span>umstances of an alleged policy violation and </span></span></div><div class="t m0 x3 h4 ycc ff4 fs2 fc0 sc0 ls0 ws0">the user&apos;s trading record before<span class="_ _0"></span> taking action. <span class="_ _1"></span> </div><div class="t m0 x2 h4 ycd ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff4 fs2">Disciplinary action may result in listing canc<span class="_ _0"></span>ellation, limits on account privileges, </span></span></div><div class="t m0 x3 h3 yce ff3 fs2 fc0 sc0 ls0 ws0">account suspension, forfeit of www.talegaon.co.in fees on cancelled listings, and loss </div><div class="t m0 x3 h4 ycf ff4 fs2 fc0 sc0 ls0 ws0">of Power-Seller status. </div><div class="t m0 x2 h4 yd0 ff5 fs4 fc0 sc0 ls0 ws0"><span class="ff6"> <span class="_ _2"> </span><span class="ff3 fs2">If a complaint can&apos;t be proven with certa<span class="_ _0"></span>int<span class="_ _1"></span>y, www.talegaon.c<span class="_ _0"></span>o.in ma<span class="_ _1"></span>y take no ac<span class="_ _0"></span>tion. <span class="_ _1"></span><span class="ff4"> </span></span></span></div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
